import React from 'react';
import './nav.css';
import Modal from './modal.component.js'

function Nav(props) {
  const linkTitle = props.value;
  const links = linkTitle.map((number) =>
    <li>
      <a className='nav nav-link' href={number[0]}>
        {number[1]}
      </a>

        {console.log(number[1])}
    </li>
  );



  return (
    <div className="navbar">
        <ul className="nav">
          {links}
          <button className='nav-link' type="submit">Login</button>
        </ul>
        <Modal/>
      </div>
  );
}

export default Nav;
